import React from 'react';
import Header from './components/Header';
import Video from './components/Video';
import logo from './assets/Logo/Logo-brainflix.png';
import uploadIcon from './assets/Icons/PNG/Icon-upload.png';

import './style/App.css';

function App() {
  return (
    <div className="app">
      <Header logo={logo} uploadIcon={uploadIcon} avatar="./images/Mohan-muruge.jpg" />
      <Video poster="./images/video-list-0.jpg" video="./video/BrainStation Sample Video.mp4" />
    </div>
  );
}

export default App;
